import React from 'react';
import './ServiceProviderProfile.css'; // Import the CSS file for styling

const ServiceProviderProfile = () => {
  return (
    <div className="profile-container">
      {/* Cover Photo */}
      <div className="cover-photo">
        {/* Your cover photo content */}
      </div>

      {/* Profile Picture, Company Name, and WhatsApp Button */}
      <div className="profile-header">
        <div className="profile-picture">
          {/* Your profile picture content */}
        </div>
        <div className="company-name">
          {/* Your company name */}
        </div>
        <button className="whatsapp-button">
          {/* WhatsApp button content */}
        </button>
      </div>

      {/* Description */}
      <div className="description">
        {/* Your description content */}
      </div>

      {/* Image Upload */}
      <div className="image-upload">
        {/* Your image upload component */}
      </div>

      {/* Packages */}
      <div className="packages-heading">
        <h2>Packages</h2>
      </div>
      <div className="packages">
        {/* Your packages content */}
      </div>
    </div>
  );
};

export default ServiceProviderProfile;
